/** @format */

import React, { Component } from 'react';
import {Card, Row, Col, Badge} from 'react-bootstrap';
class Order extends Component {
    constructor(props) {
        super();
    }

    render() {
        return (
            <Card style={{ width: '18rem' }}>
                <Card.Body>
                    <Card.Title>
                        <Row>
                            <p as={Col}>Order #000{this.props.sku}</p>
                            <Badge as={Col} bg='secondary'>
                                {this.props.status}
                            </Badge>
                        </Row>
                    </Card.Title>
                    <Card.Text>

                    </Card.Text>
                </Card.Body>
            </Card>
        );
    }
}
export default Order;
